replicaCount: 1
app:
    name: wf-front
    version: 0.1.1
    description: 'A Helm chart for Kubernetes'
    keywords: [helm, chart, kubernetes]
    namespace: dev
    dns_resolver: 10.43.0.10
    primary_dns_resolver: 10.43.0.10
    secondary_dns_resolver: 10.43.0.10
    dns_resolver_port: 53
    api_url: 'https://api.dev.brahmstra.org/api'
    redis_host: redis-service.dev.svc.cluster.local
    target_env: dev
    target_type: front
    front_url: 'https://front.dev.brahmstra.org'
    sync_data_onload: false
secure_env_file: 
image:
    repository: bwalia/whitefalcon
    pullPolicy: Always
    tag: latest
imagePullSecrets: {  }
nameOverride: ''
fullnameOverride: ''
serviceAccount:
    create: true
    annotations: {  }
    name: ''
podAnnotations: {  }
podSecurityContext: {  }
securityContext: {  }
service:
    type: ClusterIP
    port: 80
ingress:
    enabled: true
    className: traefik
    annotations: {  }
    hosts: [{ host: dev2.brahmstra.org, paths: [{ path: /, pathType: ImplementationSpecific, serviceName: wf-front-svc-dev, servicePort: 80 }] }, { host: front.dev2.brahmstra.org, paths: [{ path: /, pathType: ImplementationSpecific, serviceName: wf-front-svc-dev, servicePort: 80 }] }, { host: front-dev.brahmstra.org, paths: [{ path: /, pathType: ImplementationSpecific, serviceName: wf-front-svc-dev, servicePort: 80 }] }, { host: qa.dev.brahmstra.org, paths: [{ path: /, pathType: ImplementationSpecific, serviceName: wf-front-svc-dev, servicePort: 80 }] }, { host: nodeappdev.brahmstra.org, paths: [{ path: /, pathType: ImplementationSpecific, serviceName: wf-front-svc-dev, servicePort: 80 }] }]
    tls: {  }
resources: {  }
autoscaling:
    enabled: false
    minReplicas: 1
    maxReplicas: 100
    targetCPUUtilizationPercentage: 80
nodeSelector: {  }
tolerations: {  }
affinity: {  }
